// src/components/Header.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Typed from 'typed.js';
import './styles1.css';
import Main from './Main';

const Header = () => {
  const [navLinksVisible, setNavLinksVisible] = useState(false);

  const showMenu = () => {
    setNavLinksVisible(true);
  };

  const hideMenu = () => {
    setNavLinksVisible(false);
  };

  useEffect(() => {
    // Add your Typed.js initialization here
    const typed = new Typed(".auto-type", {
      strings: ["Learning", "Coding", "Sleeping", "Eating"],
      typeSpeed: 150,
      backSpeed: 150,
      loop: true,
    });

    // Cleanup Typed.js on component unmount
    return () => {
      typed.destroy();
    };
  }, []);

  return (
    <div id="header1">
      <section className="header">
        <Main img={require("./images/indexbanner.jpg")} className="back-video" alt="Background Video" />
        <nav>
          <div className="nav-links"  id="navLinks">
            <i className="fa fa-times" onClick={hideMenu}></i>
            <ul>
              <li><Link to="/">HOME</Link></li>
              <li><Link to="/about">ABOUT ME</Link></li>
              <li><Link to="/skills">PORTFOLIO</Link></li>
              <li><Link to="/projects">PROJECTS</Link></li>
              <li><Link to="/contact">CONTACT</Link></li>
            </ul>
          </div>
          <i className="fa fa-bars" onClick={navLinksVisible ? hideMenu : showMenu}></i>
        </nav>
        <div className="text-box">
          <ul>
            <p></p>
            <h1>I'm <span className="auto-type"></span></h1>
            <p>A passionate UI/UX Designer wanting to satisfy users' needs!</p>
            <a href="https://github.com/biomesu" className="github-btn">Github</a>
          </ul>
        </div>
      </section>
    </div>
  );
};

export default Header;
